import React from "react";
import styled from "styled-components";

const ContactForm = () => {
  return (
    <Container>
      <FormBox></FormBox>
    </Container>
  );
};

export default ContactForm;

const Container = styled.div`
  width: 100vw;
  height: 100vh;
  background-color: #151515;
`;

const FormBox = styled.div`
  width: 50%;
  height: 80vh;
  margin: 0 auto;
  padding: 10vh 0;
  background-color: #efefef;
  border-radius: 15px;
`;
